import React, {useState} from 'react';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  var lists = [];
  var i = 0;
  var [title, _title] = useState(['첫번째 게시글', '두번째 게시글', '세번째 게시글']);

  while(i < title.length){
    lists[i] = <div className="list">
      <h2>{title[i]}</h2>
      <p>2021.09.0{8+i}</p>
      <hr/>
    </div>
    i++;
  }

  return (
    <div className="App">
      <nav className="nav">
        <h1>React test page</h1>
      </nav>
      {lists}
    </div>
  );
}

export default App;
